INSERT INTO course(course_id, name, identifier, description, alternate_name, referable)
VALUES ('50b4ba04-0548-4f5c-b2cb-346ccab6fff3', 'Lavender Course', 'LC', 'Succedo aeneus quae fugit. Laudantium agnosco vinum utilis apto alveus arto appositus. Atrox tergiversatio arbor vulnero socius.', 'LC', true),
       ('17679e01-5d55-4c5a-96fe-5b975a2eb621', 'Teal Course', 'TC', 'Benigne absconditus sapiente depereo crepusculum. Tollo taedium totus beneficium vestrum cilicium. Atavus adhuc sub adaugeo valens theatrum. Tui blanditiis abstergo denique.', 'TC', true),
       ('f467f330-c861-4f98-afc6-6b68c8fa79b1', 'Lime Course', 'LC', 'Laudantium debeo cavus. Corrupti iure aqua denego crepusculum veritatis vulgo basium aeger. Spero tergeo tremo amicitia beatae. Talis corpus virtus aggredior. Concido una vae amet vorago curvo arcus apud sufficio creo.', 'LC', false),
       ('9039179a-75c4-423a-b35b-081be3e2a42e', 'Lavender Course', 'LC', 'Beatae thermae curvo suus utrum saepe admoneo ventito absque. Id vir approbo tero quae conturbo vinculum sperno deleniti.', 'LC', false),
       ('d804551e-f8d3-4fb6-8050-9916eec12a5a', 'Olive Course', 'OC', 'Cavus tot suadeo arcesso. Delectatio laudantium desparatus cenaculum peior odit triumphus sordeo ascit aliquam. Angulus decretum ante. Avaritia conatus amiculum usus.', 'OC', false),
       ('1a1f8043-0c33-4447-b786-45725de4c641', 'Ivory Course', 'IC', 'Antiquus adversus viscus tabula amet accusator. Teneo adamo quas. Atqui id utique cura. Amaritudo canto comedo tamdiu ceno.', 'IC', false),
       ('c7fde69e-7742-4731-b343-589127d895fc', 'Pink Course', 'PC', 'Dapifer aestas deporto crudelis una spiculum. Vobis adficio conscendo sollicito velociter vicissitudo cras solium vis. Cultellus admoneo nemo decet ventito.', 'PC', false),
       ('9c003df0-cab7-45e9-9c1e-cce33e68bb87', 'Gold Course', 'GC', 'Soluta infit clam tendo ceno. Cur tot canis quia conservo peior tenetur expedita conforto. Consuasor caelum esse deporto velum.', 'GC', true),
       ('418aea2c-bf70-472e-af82-4a9897103384', 'Black Course', 'BC', 'Vulariter cura vulpes crepusculum defluo corrumpo terga bis thalassinus. Vulgaris subiungo auctus ascisco depulso tremo toties. Ea nihil victoria carmen tibi necessitatibus.', 'BC', false),
       ('20aa5f72-fd20-43d4-9763-7a2d16709e73', 'Purple Course', 'PC', 'Caelestis sumo texo spiritus voveo annus ultra truculenter aureus. Comitatus vomito creo corona ait. Clamo defaeco rem curso contabesco corrumpo. Ubi amoveo facere crastinus textilis. Temperantia cauda conitor sed apostolus consuasor quod non. Praesentium strenuus adamo auxilium abbas campana tabella.', 'PC', true);

